import { Link } from "react-router-dom";

const EVENTS = [
  { id: "e1", title: "Event 1" },
  { id: "e2", title: "Event 2" },
  { id: "e3", title: "Event 3" },
];

const EventsPage = () => {
  return (
    <>
      <h1>Events page</h1>
      <ul>
        {EVENTS.map((ev) => (
          <li key={ev.id}>
            <Link to={ev.id}>
              {ev.title}
            </Link>
          </li>
        ))}
      </ul>
    </>
  );
};

export default EventsPage;
